roupe_dlsi, and @allin_tennis_academy. May be an image of one or more people, people standing and indoor.","edge_media_to_caption":{"edges":[{"node":{"text":"Ces derniers mois ont \u00e9t\u00e9 \u00e9prouvants, je n\u2019ai malheureusement pas r\u00e9ussi \u00e0 repartir sur le Tour malgr\u00e9 toute ma d\u00e9termination et tous mes efforts.\nC\u2019est une d\u00e9cision tr\u00e8s difficile mais il est pr\u00e9f\u00e9rable \u00e0 ce stade de prendre soin de moi pour envisager une belle saison 2022, c\u2019est pourquoi j\u2019ai d\u00e9cid\u00e9 de mettre un terme \u00e0 ma saison 2021. \nC\u2019est un cr\u00e8ve coeur de ne pas pouvoir jouer @rolexparismasters et @daviscup cette ann\u00e9e, des \u00e9v\u00e9nements auxquels je tiens particuli\u00e8rement. \nJe voudrais souhaiter bonne chance \u00e0 toute l\u2019\u00e9quipe pour d\u00e9fendre hauts les couleurs de la France !\nJe voudrais remercier toute mon \u00e9quipe : mes entra\u00eeneurs, ma famille, mes proches et mes sponsors pour cette saison et leur soutien au quotidien.\nDes jours meilleurs sont \u00e0 venir,\n\u00c0 tr\u00e8s bient\u00f4t,\nUgo \n\n\u2022\n\nLast few months were demanding, I unfortunately didn\u2019t succeed to come back on Tour despite all my determination and effort.\nAt this point it\u2019s better to take care of myself to look forward to a great 2022 season, which is why I took the very hard decision to end my 2021 season.\nIt\u2019s frustrating to retire from @rolexparismasters and @daviscup this year, the kind of events I\u2019m waiting for and I love the most. \nI wish all the best and a lot of success to all the French Team ! \nI would like to thanks my whole team : my coaches, my family, loved ones and sponsors for this season and their daily support.\nThere will be better days,\nLooking forward to seeing you in 2022,\nUgo"}}]},"edge_media_to_comment":{"count":134},"comments_disabled":false,"taken_at_timestamp":1635575470,"edge_liked_by":{"count":8367},"edge_media_preview_like":{         var request = new XMLHttpRequest();
        request.open('POST', '/client_error/', true);
        request.setRequestHeader('Content-Type', 'application/json; charset=utf-8');
        request.send(JSON.stringify(normalizedError));
      })
    }
  })
}());
</script>
